webpackJsonp([0xcbf1b5d27c4],{644:function(A,e){A.exports={data:{profile:{id:"f6d554e0-e882-58b2-9061-d3f61b1c53df",content:'<p><div class="content-block  text-center"><p>Chris began his musical life as a pianist, but after realizing the beauty and power of the bass line during his high school years, he had progressed into a full-on bassist by his late teens. Correspondingly, after a few semesters of University study of jazz piano in his home state of Maine, he later completed his Bachelor of Fine Arts in Music at UMASS Boston as a bassist.</p></div></p>\n<p><div class="content-block  text-center"><p>Now Chris has been hauling his basses around New England and across the country for almost fifteen years. This includes performing and recording original music with two-time Boston Music Award nominated swing/lounge act &#8220;Lars Vegas&#8221;, and nearly ten years of Wednesday nights in Cambridge&#8217;s &#8220;Plough and Stars&#8221; with the original American song stylings of the &#8220;Bad Art Ensemble&#8221;.</p></div></p>\n<p><div class="content-block  text-center"><p>Chris has also worked with singer/songwriters Milo Jones and Claire Muldaur. His most recent endeavor was spending much of the last three years &#8220;in the van&#8221; with Funzalo recording artist &#8220;Spookie Daly Pride&#8221;. He has years of experience performing reggae and soca music with Boston&#8217;s &#8220;Jah Spirit&#8221; and &#8220;Caribbean Cruize Band&#8221;. He continues to work in original projects and plays countless private and corporate functions such as jazz cocktail receptions, upscale dinner parties, and weddings to name a few.</p></div></p>\n<p><div class="content-block  text-center"><p>Influential and favorite bassists include Donald &#8220;Duck&#8221; Dunn, James Jamerson, Aston &#8220;Family Man&#8221; Barrett, Bill Laswell, Sting, Charles Mingus, Ray Brownt and Charlie Haden.</p></div></p>\n<p><div class="content-block  text-center"><p>Favorite composers include Thelonious Monk, Charles Mingus. Ornette Coleman, Cole Porter, and Antonio Carlos Jobim.</p></div></p>\n<p><div class="content-block  text-center"><p>Chris also offers private lessons on bass, piano, and guitar. Please call 617-290-1677 or email forkeychris@hotmail.com if interested.</p></div></p>\n',title:"Chris Forkey",acf:{title:"Upright & Electric Bass",video:null,facebook:"",instagram:"",testimonials:""},image:{localFile:{childImageSharp:{thumbnail:{base64:"data:image/jpeg;base64,",aspectRatio:.6666666666666666,src:"/static/415b42cb4c5685e013772d49d325227a-040766b169f75a8f46699dc446be59fd-06ad8.jpg",srcSet:"/static/415b42cb4c5685e013772d49d325227a-040766b169f75a8f46699dc446be59fd-a24bd.jpg 110w,\n/static/415b42cb4c5685e013772d49d325227a-040766b169f75a8f46699dc446be59fd-06ad8.jpg 200w",sizes:"(max-width: 200px) 100vw, 200px",originalImg:"/static/415b42cb4c5685e013772d49d325227a-040766b169f75a8f46699dc446be59fd-06ad8.jpg"},full:{src:"/static/415b42cb4c5685e013772d49d325227a-040766b169f75a8f46699dc446be59fd-edd6d.jpg",height:300,width:200,srcSet:"/static/415b42cb4c5685e013772d49d325227a-040766b169f75a8f46699dc446be59fd-edd6d.jpg 1x"}}}},yoast:{title:"",canonical:"",metaDescription:"",linkdex:"",metakeywords:"",noIndex:"",noFollow:"",meta_robots_adv:"",metaKeywords:"",redirect:"",ogTitle:"",ogDescription:"",ogImage:"",twitterTitle:"",twitterDescription:"",twitterImage:""}},site:{id:"Site",siteMeta:{title:"C-Zone Entertainment",subtitle:"Premiere DJs & Musicians | Servicing Greater Boston & New England | 617.320.0723"}}},pathContext:{id:"f6d554e0-e882-58b2-9061-d3f61b1c53df"}}}});
